import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


const SuperHero = () => {

    const aquaMan = "Аквамэн";
    const batMan = "Бэтмэн";
    const ciBorg = "Киборг";
    const flash = 'Флэш';
    const greenLantern = 'Зеленый';
    const superGirl = 'Супергирла';
    const superMan = "Супермэн";
    const wonderWoman = "Вумэн";
    const blackPanther = "Пантера";

    return (
        <div>
            <div className="board-new">
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/aquaman.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{aquaMan}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/batman.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{batMan}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/cyborg.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{ciBorg}</div>
                </div>
            </div>
            <div className="board-new">
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/flash.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{flash}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/greenlantern.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{greenLantern}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/supergirl.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{superGirl}</div>
                </div>
            </div>
            <div className="board-new">
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/superman.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{superMan}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/dc/wonderwoman.jpg" alt="" width="90"
                                                  height="100"></img>}
                    <div className="aquaMan">{wonderWoman}</div>
                </div>
                <div className="board-new1">{<img src="http://www.ramrus.ru/pic/marvel/blackpanther.jpg" alt=""
                                                  width="90" height="100"></img>}
                    <div className="aquaMan">{blackPanther}</div>
                </div>
            </div>
        </div>
    );

}


class SearchBar extends React.Component {
    render() {
        return (
            <div className="d1">
                <form>
                    <input type="text" placeholder="Имя героя..."/>
                    <button type="submit"></button>
                </form>
            </div>
        );
    }
}

class FilterableProductTable extends React.Component {
    render() {
        return (
            <div>
                <SuperHero/>
            </div>
        );
    }
}


ReactDOM.render(
    <div className="product">
        <SearchBar/>
        <FilterableProductTable/>

    </div>,
    document.getElementById('root')
);
